import * as React from 'react'
import { Button, StyleSheet, TextInput, Text, View } from 'react-native'

export default function CalendarScreen({ navigation }) {
  return (
    <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
      <Text>Calendar</Text>
    </View>
  )
}
